import React from 'react'
import "./Filter.css"
import {useRef} from 'react'

export default function CheckBoxComponent({value,isChecked}) {

  const [clickSelected,setClickSelected]=useRef(false)

  if (isChecked) {
    setClickSelected(true)
  }

  return (
    <div className='checkboxComponentDiv' >
      <input type="checkbox" className='checks' ref={clickSelected} checked={isChecked}/><span className='checkboxComponents'>{value}</span>
    </div>
  )
}
